import Head from "next/head";

import { ItemsTable } from "react-monday-ui";

const Home = () => (
  <>
    <div className="container">
      <ItemsTable />
    </div>

    <style jsx>{`
      .container {
        max-width: 1200px;
      }
    `}</style>
  </>
);

export default Home;
